--
-- Name: drop_constraints(character varying, character varying); Type: FUNCTION; Schema: public; Owner: axum
--

CREATE FUNCTION drop_constraints(table_name_to_check character varying, column_name_to_check character varying) RETURNS integer
    AS $$
DECLARE
  con varchar;
  cnt integer;
BEGIN
  cnt := 0;
  FOR con IN (SELECT constraint_name FROM information_schema.constraint_column_usage WHERE table_catalog = 'axum' AND table_name = table_name_to_check AND column_name = column_name_to_check)
  LOOP 
    EXECUTE 'ALTER TABLE ' || table_name_to_check || ' DROP CONSTRAINT ' || con;
    cnt := cnt+1;
  END LOOP;
  RETURN cnt;
END
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.drop_constraints(table_name_to_check character varying, column_name_to_check character varying) OWNER TO axum;

