CREATE VIEW matrix_sources AS
    (((((SELECT 1 AS pos, 'none' AS type, (-1) AS number, 'mute' AS label, true AS active, src_pool.pool1, src_pool.pool2, src_pool.pool3, src_pool.pool4, src_pool.pool5, src_pool.pool6, src_pool.pool7, src_pool.pool8 FROM src_pool WHERE (src_pool.number = (-1)) UNION SELECT 2 AS pos, 'none' AS type, 0 AS number, 'none' AS label, true AS active, src_pool.pool1, src_pool.pool2, src_pool.pool3, src_pool.pool4, src_pool.pool5, src_pool.pool6, src_pool.pool7, src_pool.pool8 FROM src_pool WHERE (src_pool.number = 0)) UNION SELECT (2 + src_config.pos) AS pos, 'source' AS type, (src_config.number + 288) AS number, src_config.label, true AS active, src_config.pool1, src_config.pool2, src_config.pool3, src_config.pool4, src_config.pool5, src_config.pool6, src_config.pool7, src_config.pool8 FROM src_config) UNION SELECT ((2 + buss_config.number) + (SELECT max(src_config.pos) AS max FROM src_config)) AS pos, 'buss' AS type, buss_config.number, buss_config.label, true AS active, src_pool.pool1, src_pool.pool2, src_pool.pool3, src_pool.pool4, src_pool.pool5, src_pool.pool6, src_pool.pool7, src_pool.pool8 FROM (buss_config JOIN src_pool ON ((buss_config.number = src_pool.number)))) UNION SELECT (((2 + monitor_buss_config.number) + (SELECT max(src_config.pos) AS max FROM src_config)) + 16) AS pos, 'monitor buss' AS type, (monitor_buss_config.number + 16) AS number, monitor_buss_config.label, (monitor_buss_config.number <= (dsp_count() * 4)) AS active, src_pool.pool1, src_pool.pool2, src_pool.pool3, src_pool.pool4, src_pool.pool5, src_pool.pool6, src_pool.pool7, src_pool.pool8 FROM (monitor_buss_config JOIN src_pool ON (((monitor_buss_config.number + 16) = src_pool.number)))) UNION SELECT (((2 + g.n) + (SELECT max(src_config.pos) AS max FROM src_config)) + 32) AS pos, 'insert out' AS type, (g.n + 32) AS number, (('Module '::text || g.n) || ' insert out'::text) AS label, (g.n <= (dsp_count() * 32)) AS active, src_pool.pool1, src_pool.pool2, src_pool.pool3, src_pool.pool4, src_pool.pool5, src_pool.pool6, src_pool.pool7, src_pool.pool8 FROM (generate_series(1, 128) g(n) JOIN src_pool ON (((g.n + 32) = src_pool.number)))) UNION SELECT (((2 + g.n) + (SELECT max(src_config.pos) AS max FROM src_config)) + 160) AS pos, 'n-1' AS type, (g.n + 160) AS number, (('Module '::text || g.n) || ' N-1'::text) AS label, (g.n <= (dsp_count() * 32)) AS active, src_pool.pool1, src_pool.pool2, src_pool.pool3, src_pool.pool4, src_pool.pool5, src_pool.pool6, src_pool.pool7, src_pool.pool8 FROM (generate_series(1, 128) g(n) JOIN src_pool ON (((g.n + 160) = src_pool.number)));


